import './App.css';

export interface Props {
    // onClickButton: React.MouseEventHandler<HTMLButtonElement>
    // movie: String
}

export class App extends React.Component<Props> {

    render() {
        const movie = 'The Godfather';

        return (
            <React.Fragment>
                <Header/>
                {/*<Main onclickButton={onClickButton} movie={movie}/>*/}
            </React.Fragment>
        );
    }
}

const Header: React.SFC = () => (
    <div className={'siteTop'}>
        <h1>LMDB: Lica's Movie Database</h1>
    </div>
);

interface clickButton {
    onClickButton: React.MouseEventHandler<HTMLButtonElement>
    movie: 'The Godfather'
}

const Main: React.SFC<clickButton> = ({onClickButton, movie}) => (
    <div className={'body'}>
        <button className={'favMovieButton'} onClick={onClickButton}>
            {movie}
        </button>
    </div>
);



export default App;
